import { useEffect, useState } from 'react';
import './App.css';

function App() {

  let[articles,setArticles]=useState([]);

  useEffect(()=>{
   fetch("https://newsapi.org/v2/everything?q=jobs&q=india&from=2024-02-10&apiKey=1f270b533d8b434b83f60e04a0d583a6")
   .then((response)=>response.json())
   .then((news)=>{
    setArticles(news.articles);
   })
   .catch((err)=>{
    console.log(err);
   })


  },[])

  return (
    <div className="App">
      <h1>NEWS APP</h1>

    </div>
  );
}

export default App;
